script: |
  super -f text -I q11118.spq | sort > q11118.out

inputs:
  - name: q11118.spq
    data: |
      SELECT DISTINCT - col0 * + col0 + - col0 * - col0 * 33 + + cor0.col2 * + col1 * ( - col2 + col2 ) AS col0 FROM tab0 (FORMAT parquet) cor0;
  - name: tab0

outputs:
  - name: q11118.out
    data: |
      18432
      253472
      39200
